Decided to whip up a fresh club bootleg remix of ATB, Topic & A7S' - Your Love (9PM). 
Loved the original so thought I would put this one out for you guys! Enjoy!

Free Download - https://bit.ly/3rpPUtr

[NOTE: This is a bootleg, not an official remix]

@atb-music
@topicmusic
@virginrecords

@yemanjo

"The original composition of this track is by the Sudanese Oud master Hamza al Din.  I've loved it for many years, especially on long car rides through the woods...the beginning has such a beautiful dark mystery to it, balanced by the major-key tone of the second half.  The driving rhythm of the cello reminds me of running water and sounds so good with a nice downtempo beat." 
Ben Harris aka @yemanjo
